window.bookSummaryJSON = "<p><b>Get the </b><b><i>Tradepoint Saga Box Set</i></b><b>, featuring all three books in the series. A lengthy space opera filled with political intrigue, mystery, and a diverse cast of characters!</b></p> <p>Nine hundred Vennans undertake a cultural exchange to Tradepoint, a space station where aliens from different worlds meet to do business. A young and gifted Speaker, Gredin, is translator and diplomat for the happy occasion.</p> <p>But a horrific vision shatters her first night’s sleep on Tradepoint. Venna, their homeworld, has been destroyed. Now, the safety of the delegation, the only Vennans left in all of time and space, rests on Gredin’s young shoulders.</p> <p>Stunned and grieving, she navigates trade wars and political prejudice, bartering with other races - some friendly, some neutral, some outright hostile - for what her people need to survive. And the cost of failure is the unthinkable.</p> <p>Extinction.</p> <p><b>Buy this special-edition omnibus to experience this complete space-opera trilogy today. This coming-of-age tale is perfect for fans of CJ Cherryh, Arkady Martine, Wen Spencer, and </b><b><i>Star Trek: Picard</i></b><b>.</b></p> <p>This bundle contains three full-length novels: <i>Refuge</i>, <i>Aftershock</i>, and <i>The Bereft</i>.</p>"; 
